module.exports = {
    'text:list': function(styles) {
        // Remove last opened list tag
        styles['lists'].openedTags.pop();
    },
    'text:note-citation': function(styles, footnotes) {
        footnotes.onId = false;
    },
    'text:note-body': function(styles, footnotes) {
        footnotes.onBody = false;
        footnotes.list.push(footnotes.current);
        footnotes.current = null;
    },
    'draw:frame': function(styles, footnotes, frames) {
        frames.current = null;
    },
};